import logo from './logo.svg';
import './App.css';
import Search from './components/Search';
import styled from '@emotion/styled'


const NavContainer = styled.nav({
  marginLeft: '20px',
  marginTop: '20px',
  padding: '10px'
})

const DropDown = styled.select({
  border: '0px',

})

function App() {
  return (
    <>
      <NavContainer>
        <DropDown>
          <option>Admin</option>
          <option>Regular</option>
        </DropDown>
      </NavContainer>
      <div className="App-header">
        <Search />
      </div>
    </>
  );
}

export default App;
